import random
class RandomizedSet:
    def __init__(self):
        self.elementMapper = dict()
        self.elements = list()

    def insert(self, val):
        if val in self.elementMapper:
            return False
        else:
            self.elementMapper[val] = len(self.elements)
            self.elements.append(val)
            return True

    def remove(self, val):
        if val in self.elementMapper:
            # get list last element
            elementToBeSwapped = self.elements[len(self.elements) - 1]

            # get val's index from mapper
            valIndex = self.elementMapper[val]

            # swap location of val and last element in list
            self.elements[valIndex] = elementToBeSwapped

            # pop last element
            self.elements.pop()

            # update last element's new index in the mapper
            self.elementMapper[elementToBeSwapped] = valIndex

            # del val from mapper
            del self.elementMapper[val]
            return True
        else:
            return False

    def getRandom(self):
        return random.choice(self.elements)

class RandomizedSetApproachSet:

    def __init__(self):
        """
        Initialize your data structure here.
        """
        self.randomizedSet = set()

    def insert(self, val: int) -> bool:
        """
        Inserts a value to the set. Returns true if the set did not already contain the specified element.
        """
        if val not in self.randomizedSet:
            self.randomizedSet.add(val)
            return True
        else:
            return False

    def remove(self, val: int) -> bool:
        """
        Removes a value from the set. Returns true if the set contained the specified element.
        """
        if val in self.randomizedSet:
            self.randomizedSet.remove(val)
            return True
        else:
            return False

    def getRandom(self) -> int:
        """
        Get a random element from the set.
        """
        randomElement = self.randomizedSet.pop()
        self.randomizedSet.add(randomElement)
        return randomElement


